-- ----------------------------
-- Table structure for maoding_web_notice
-- ----------------------------
DROP TABLE IF EXISTS `maoding_web_notice`;
CREATE TABLE `maoding_web_notice` (
  `id` varchar(32) NOT NULL COMMENT '主键id，uuid',
  `notice_title` varchar(300) DEFAULT NULL COMMENT '公告标题',
  `notice_content` longtext COMMENT '公告内容',
  `notice_no` varchar(20) DEFAULT NULL COMMENT '公告编号',
  `notice_status` varchar(1) DEFAULT NULL COMMENT '公告状态(1.已删除，0.已发布,2:已读)',
  `notice_is_push` varchar(1) DEFAULT NULL COMMENT '是否推送(0.不推送，1.推送)',
  `company_id` varchar(32) DEFAULT NULL COMMENT '所属企业',
  `notice_publisher` varchar(32) DEFAULT NULL COMMENT '发布人',
  `notice_publishdate` date DEFAULT NULL COMMENT '发布时间',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `create_by` varchar(32) DEFAULT NULL COMMENT '创建人',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `update_by` varchar(32) DEFAULT NULL COMMENT '更新人',
  PRIMARY KEY (`id`),
  KEY `company_id` (`company_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='通知公告表';

